window.bookSummaryJSON = "<p><b>The new novel in Craig Johnson's beloved </b><b><i>New York Times</i></b><b> best-selling Longmire series.</b></p> <p>Attempting to recover from his harrowing experiences in Mexico, in Land of Wolves Wyoming Sheriff Walt Longmire is neck deep in the investigation of what could or could not be the suicidal hanging of a shepherd. With unsettling connections to a Basque family with a reputation for removing the legs of Absaroka County sheriffs, matters become even more complicated with the appearance of an oversize wolf in the Big Horn Mountains to which Walt finds himself feeling more and more empathetic.</p>"; 
